import React from "react";

const Review = () => {
  return (
    <div className="container col-md-4">
      <form action="submit" className="form-inline">
        <div className="form-group mx-auto mb-1">
          <input type="text" placeholder="User" className="mb-4" />
          <input type="text" placeholder="Insert review" className="h-100" />
        </div>
      </form>
    </div>
  );
};

export default Review;
